        <div className="post">
            <Avatar alt="Remy Sharp" src="https://picsum.photos/536/354" className={classes} />


            <h3>Username</h3>
            <img className="post__image" src="https://picsum.photos/536/354" alt="" />
            <h4 className="post__text"><b>Donald</b>: Random pictures</h4>
        </div>
    )
}

export default Post
